import React from 'react';
import { useSelector } from 'react-redux';
import './FacultyProfile.css';
import Logout from '../Logout/Logout';
import 'bootstrap/dist/css/bootstrap.min.css';

const FacultyProfile = () => {
  const { user, isAuthenticated } = useSelector((state) => state.facultyHODAdmin);

  if (!isAuthenticated || !user) {
    return <div className="alert alert-warning" role="alert">Please log in to access your profile.</div>;
  }

  return (
    <div className="container profile-container">
      <div className="profile-header d-flex justify-content-between align-items-center my-4">
        <h2>Faculty Profile</h2>
        <nav className="profile-nav">
          <ul className="nav">
            <li className="nav-item">
              <a className="nav-link" href="/request-guest-lecture">Request Guest Lecture</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="/dashboard">Dashboard</a>
            </li>
          </ul>
        </nav>
        <Logout />
      </div>
      
      <div className="card mb-3">
        <div className="card-body">
          <h3 className="card-title">Welcome, {user.username}</h3>
          <p className="card-text">Here you can manage your guest lecture requests and view your dashboard.</p>
        </div>
      </div>
      
      <div className="card">
        <div className="card-body">
          <h3 className="card-title">Quick Actions</h3>
          <ul className="list-group list-group-flush">
            <li className="list-group-item"><a href="/request-guest-lecture">Submit a new guest lecture request</a></li>
            <li className="list-group-item"><a href="/dashboard">View your dashboard</a></li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default FacultyProfile;
